#include <bits/stdc++.h>
using namespace std;
int main(){int n,m; if(!(cin>>n>>m)) return 0; vector<vector<long long>>a(n,vector<long long>(m)); for(int i=0;i<n;i++) for(int j=0;j<m;j++) cin>>a[i][j]; long long target; cin>>target; int l=0,r=n*m-1; while(l<=r){ int mid=(l+r)/2; long long val=a[mid/m][mid%m]; if(val==target){ cout<<"true"; return 0;} if(val<target) l=mid+1; else r=mid-1;} cout<<"false"; }